R["oh__@kitsun.dark"]="{['Version']=1773,['eu']={[32]={['D']='This is actually my old build. I just changed it a bit. This house is inspired by the Summerset main questline and the creatures introduced by this story and location.\\n\"Each sea sload is unique. They can control the mind as K\\'tora and open portals to other dimensions as Z\\'maja. What if you live in an illusion created by a sea sload?\"',['O']=19830,['N']='Sea Sload\\'s Dream',['C']=1.019000,},[33]={['D']='This house has been in need of repair for a long time, but the owner only cares about one thing - no uninvited guests. What could be better than spending an evening reading a book or eating hot dinner in the fresh air. And let the roof leak, holes in the walls, and the house has almost merged with nature - this is his secluded hut.',['O']=19565,['N']='Hermit\\'s hut',['C']=1.051000,},[98]={['D']='It wasn\\'t a good idea to make a deal with the Tsar of the Sea...',['O']=19630,['N']='Bard and Sea King',['C']=1.019000,},[37]={['D']='You were walking in the woods and wandered here. This cozy quiet village is no different from the others, isn\\'t it? Well, you should know that all its inhabitants are werewolves. Faced with the rejection of society, it was much easier for the local residents to arrange their lives among the same as them. Take your time, visit the local tavern and bookstore. Don\\'t worry, you\\'re safe! (Unless it\\'s a full moon, of course).',['O']=19567,['N']='Village in the grove',['C']=1.041000,},[70]={['D']='The life of mortals is fleeting, and this world is insignificant compared to the power of the daedra and divines.',['O']=19565,['N']='Small Nirn',['C']=1.019000,},[71]={['D']='What could be better than having your own learned cat? For complete happiness, you only need a cozy home. And even if it\\'s a little cramped here, there is everything you need for your alchemy practice.',['O']=19836,['N']='The Learned Cat home',['C']=1.031000,},[72]={['D']='It\\'s a wonderful evening for a walk. The roofs of the houses dissolve into the night sky, and the autumn rustle soothes. But what is it? There\\'s something unsettling in this beautiful vision. Suddenly, you remember... A forgotten Daedric ritual, Ithelia, the threads of fate are damaged. Deals with the Daedra never end well, don\\'t they? You see how reality crumbles into thousands of pieces... It\\'s too late.',['O']=19846,['N']='Mind Trap',['C']=1.026000,},[41]={['D']='The fallen leaves tell a story. In our home, across the fog, the Lands Between...\\r\\nInspired by the amazing Elden Ring game, but with a bit of fantasy)',['O']=19582,['N']='The Lands Between',['C']=1.026000,},[43]={['D']='The owner of this place was obsessed with creating mechanisms that are able to exist independently in the wild. In the end, it was nature that absorbed his creations. There are rumors that the inventor died right in this garden from sadness, unable to come to terms with the power of true nature.',['O']=19567,['N']='Abandoned Garden',['C']=1.020000,},[12]={['D']='This tiny town rarely welcomes guests, but during these Christmas holidays, its inhabitants will make an exception for you! ',['O']=19707,['N']='Wintervalley',['C']=1.022000,},[14]={['D']='Looks like it\\'s a great early winter day. You have already prepared for the celebration of a New Life and two charming gnomes have come to visit you. Just relax and enjoy your dinner!',['O']=19566,['N']='Small winter house',['C']=1.022000,},[49]={['D']='Oh, do you love mushroom soup? And what about human soup? Today\\'s special is delicious pumpkin soup with human heads, and the chef also serves sweetrolls for dessert.\\r\\nP.S. The guard usually sits drunk in the tavern, so protect yourself.',['O']=19660,['N']='Evil Mushrooms Town',['C']=1.041000,},[23]={['D']='Tiny pumpkins draw magical energy from dark sources - this is the secret of longevity and prosperity of this village. Follow the road to the right, past the bakery, to explore the dark wizard\\'s lair.',['O']=19834,['N']='Pumpkinhill',['C']=1.041000,},[5]={['D']='',['O']=19568,['N']='Tea Room',['C']=1.031000,},[25]={['D']='In the dead of night, if you know the secret path, you can visit this strange little shop selling effective and deadly potions. Don\\'t try to leave without paying if you don\\'t want to deal with a strict guardian wolf!',['O']=19574,['N']='Small Alchemy Shop',['C']=1.020000,},[26]={['D']='You woke up in your cozy mushroom house, with a wonderful autumn day outside. It\\'s time to go for a walk around the town and buy a couple of sweetrolls.',['O']=19738,['N']='Autumn Day',['C']=1.041000,},[91]={['D']='Dragons? In your own homeland! \\nDovah invites you for a cup of milk. Don\\'t worry about Caska, she voluntarily decided to ride.',['O']=19693,['N']='Spring Dragon',['C']=1.020000,},[44]={['D']='Ezabi explored the coastal cave and found a passage to this small village. Perhaps this one will stay here for a cup of milk.',['O']=19568,['N']='Morning on the coast',['C']=1.041000,},[6]={['D']='Tiny forest dwellers invite you to visit their little village',['O']=19568,['N']='Tiny forest houses',['C']=1.041000,},[30]={['D']='This strange house is just like its owner, an old alchemist - old, untidy and even has a hat! ',['O']=19568,['N']='Autumn Mushroom',['C']=1.031000,},[11]={['D']='\"Can\\'t say this beats sleeping on a bridge somewhere. But it\\'s a fine enough place.\" (c) Sharp-as-Night',['O']=20000,['C']=1.051000,['N']='Humble Argonian Nook',},},['na']={[25]={['D']='Just little pumpkins',['O']=19633,['N']='Pumpkins',['C']=1.033000,},[71]={['D']='Who would have guessed that exploring a mysterious large hollow in a tree would lead you to this village from a fairy tale. May we interest you with the tastiest honey?',['O']=19567,['N']='Fairytale Village',['C']=1.041000,},[47]={['D']='Mizzik asked me to help him find his missing friend, who had stopped in this mysterious, sealed town. Something felt off, like a heavy shadow loomed over this peculiar hote