R["oh__@annonere"]="{['Key']='oh__@annonere',['na']={[64]={['N']='Murkmire Pyramid',['O']=19951,['C']=1.018000,},[98]={['N']='Whisper Hall Castle',['C']=1.017000,['O']=19963,['D']='Whispering Hall is a fortress located on the southern most island of the Attrian Islands chain off the western shores of the Gold Coast. It is home to Baron Reikos Taverra, a distant cousin of the Ascentros family who rule over the greater island of Attria. Feel free to use as an RP location, and don\\'t feel obligated to use the backstory if you wish to use it for your own RP.',},[36]={['N']='Red Oasis Suite',['O']=19737,['C']=1.007000,['D']='The private master suite of the Khajiiti-themed Red Oasis Tea House is a luxurious space for the most esteemed of overnight-stay clientele. It has a spacious private bedroom with an in-room bath, a private entertainment room with its own stage, games, and food, and a luxury spa.',},[70]={['N']='Red Oasis Tea House',['O']=18747,['C']=1.024000,},[71]={['N']='Snow Lily Cottage',['O']=19276,['C']=1.021000,['D']='Snow Lily Farmstead is a quiet farmhouse tucked away in a lush forest and is home to a wide variety of farm animals. The homestead is quaint but spacious and is home to the land owner.',},[41]={['N']='Attria Township',['O']=18747,['C']=1.041000,},[74]={['N']='Baandari City',['O']=18754,['C']=1.041000,},[11]={['O']=18413,['N']='Azura\\'s Grotto',},[45]={['N']='Ember Star Ship',['O']=19699,['C']=1.015000,['D']='The Black Widow is a ship feared throughout the Abecean Sea and is captained by the pirate, Lord Cardinal. When not being used for pirating, the ship masks as a merchant vessel and is quite stately in appearance both inside and out.',},[46]={['N']='Monaleste Cottage',['O']=18798,['C']=1.007000,},[47]={['N']='Grand Ballroom',['O']=19646,['C']=1.013000,['D']='This elegant feasting hall is open to all as a public venue.',},[48]={['N']='Caspian\\'s Cottage',['O']=19654,['C']=1.007000,['D']='Caspian\\'s cozy cottage rests in a private, hidden valley accessible only through an abandoned barrow in Skyrim. The cottage includes an alchemy garden, alchemy room, and carpentry workshop.',},[81]={['N']='Dragonroost Springs',['O']=19669,['C']=1.014000,['D']='Dragonroost Springs Bathhouse is a cozy getaway in the Jerall Mountains of Skyrim. It has three main mineral hotsprings to choose from, and a romantic, private hotspring above the roaring waterfall.',},[83]={['N']='Silverbane Mine',['O']=18832,['C']=1.007000,['D']='Formerly a silver mine, now a den for smugglers and thieves!',},[86]={['N']='Divina Lacrimae Bath',['O']=18747,['C']=1.014000,},[88]={['N']='The Garden Tea House',['O']=18853,['C']=1.007000,['D']='The Garden Tea House is a relaxing venue with fine tea and delicious sweets, surrounded by a peaceful, garden-themed aesthetic.',},[56]={['O']=18413,['N']='Mzathurzhel',},[57]={['N']='Palatium Attria',['O']=19810,['C']=1.007000,['D']='A gift to the members of House Ascentros from the Redguard architect, Minar al-Nivi\\'i -- renovated by the former Count of Attria, Julian Ascentros -- this splendid palace is the jewel of the island and is home to the current Count, Orien Ascentros, and his family.',},[78]={['N']='Solitude Townhouse',['O']=19671,['C']=1.007000,['D']='',},[80]={['N']='Amaranthine Hall',['O']=19830,['C']=1.017000,['D']='Amaranthine Hall is the castle headquarters for the Order of the Amaranthine Ring located in teh Jerall Mountains north of Bruma. It was once a powerful stronghold for the Order, which fell into disrepair and was forgotten, only to be taken over by dark forces who wanted the castle for its dark secret hidden within its bowels. Recently reclaimed by the Order and renovated, it is, once again, a majestic fortification where the Order\\'s members may gather.',},[60]={['N']='Snowrest Port',['O']=18747,['C']=1.041000,},[61]={['N']='Rosewood Village',['O']=18972,['C']=1.041000,['D']='New location of Rosewood Village. Was formerly in my Moon-Sugar Meadow.',},[105]={['N']='Haunted Ayleid Manor',['O']=19937,['C']=1.007000,['D']='These haunted woods reside in a pocket realm of Oblivion, where an Ayleid garden and cottage have been lost to time -- until now. Spectral guardians and animals wander the grounds, and a quaint cottage sits as it was when it disappeared, forever awaiting the return of its owner, or, perhaps welcoming in someone new, should they be so lucky as to find it.',},[75]={['N']='Nightrose Tavern',['O']=19951,['C']=1.007000,['D']='Nightrose Tavern is owned and operated by the Order of the Amaranthine Ring. It sits on the lakeside of a former orc village, which has since become a nord village after the former residents abandoned the site a century eariler. The tavern itself consists of the main establishment, with a hidden speakeasy which is accessible via the stable.',},},['TS']=1724863428,['Version']=1773,}"
