R["oh__@krysann"]="{['Version']=1773,['Key']='oh__@krysann',['TS']=1724289920,['na']={[17]={['D']='After a life of adventure, she settles down to this quite home in a sleepy village surrounded by her pets, books, and plants. Visitors welcome! Please don\\'t mind the mess, and if the kitten is stuck on the corner couch, please help. Also cat fur is just seasoning!',['O']=19690,['C']=1.046000,['N']='Fell\\'s Run House',},[18]={['D']='This inn has opened in the residential district of Wayrest to offer travelers more than a convenient location for shopping and crafting. Rooms of various price points for groups and individuals, on-site dining, drinks, and gaming, and a lovely garden perfect for promising eternal devotion to a favored person.',['C']=1.051000,['O']=19957,['N']='Wayrest House Inn',},[20]={['D']='A scholars retreat.',['O']=19826,['C']=1.051000,['N']='Narsis House',},[71]={['D']='This quiet fishing village on the way to Jode\\'s temple has almost everything needed for the traveling pilgrim. Friendly pub, blacksmith to repair broken wagons, fresh fish, even a newly opened winery. And if its very late a comfortable beach to sleep under the stars on!',['O']=19628,['C']=1.041000,['N']='Elsweyr Meadow',},[88]={['D']='With some remodeling, this home has been converted into a dance studio and private medical office for a convenient commute from a warm welcoming family home across the causeway. Complete with upstairs laundry and two bedrooms. Now if only toys would not be left on the stairs.',['O']=19380,['C']=1.051000,['N']='Leyawiin Bridge Home',},[23]={['D']='Scrubbed clean and ready for your next romantic getaway! Escape to this comfortable cottage and lounge by the private pool, or choose to enjoy the in-suite hot tub. (Please don\\'t leave the door to the compound open, the kittens don\\'t know the way home yet.)',['O']=19800,['C']=1.021000,['N']='Feline Romance',},[27]={['D']='Custom build cottage by a pond.\\n',['O']=19826,['C']=1.050000,['N']='Arenthia House',},[59]={['D']='Recently renovated and now open accepting applications for one open studio, Alinor Crest Townhomes offers loft studios and one bedrooms for long-term lease. Perfect for those looking for city living at reasonable prices. No pets, smoking, or daedric worship please. ',['O']=19957,['C']=1.046000,['N']='Alinor Apartments',},[92]={['D']='Fargrave Museum of Art and Stuff',['C']=1.030000,['O']=19957,['N']='Fargrave Museum',},[49]={['D']='After a long adventure, she finally settled in this quiet cottage. Near enough to town for groceries, but quiet enough no one will much mind how bossy the Queen can be. ',['O']=19957,['C']=1.046000,['N']='Retirement Garden',},[28]={['D']='Now that the children are grown with children of their own, this family cottage has become the place for the next generation to gather for holidays and vacations. Upgrades from Nana and Papa’s day include an oven with no need for wood, and a shower. Now if only there was a way to not have to risk frostbite for late night dashes to the bathroom…',['O']=19826,['C']=1.051000,['N']='Nimalten House',},[63]={['D']='Home to an alchemist with a serious interest in creating and growing crystals, just waiting for spring to make her new crafting lab arc with magical energy. Meanwhile, the home is comfortable and warm for family and friends to visit over the holidays.',['O']=19826,['C']=1.022000,['N']='New Life Snow Globe',},},}"
