R["oh__@yogurt4"]="{['Key']='oh__@yogurt4',['na']={[49]={['O']=19850,['C']=1.013000,['D']='Welcome to the Sheogorath’s Springtime Banquet and Sweetroll hunt!\\r\\nIn celebration of the coming of spring, the Jesters Festival, and perhaps just for the amusement of Sheogorath, the influencing madness of the Shivering Isles has afflicted a small woodland grove in the daggerfall region of Tamriel.  Enjoy a full breakfast banquet with formerly “live” entertainment in this enchanted woodland cottage.\\r\\n(Also 10 Sweetrolls are hidden throughout the build! Find them all to win absolutely nothing!)\\r',['N']='Springtime Banquet',},[2]={['O']=19879,['C']=1.012000,['D']='Deep sea exploration',['N']='Deep Sea',},[3]={['O']=19742,['C']=1.028000,['D']='Private room avaliable for rental',['N']='Debauchery Den',},[21]={['O']=19786,['C']=1.012000,['D']='Mournhold Aquarium and Aquatic Gardens',['N']='Mournhold Aquarium',},[70]={['O']=19742,['C']=1.041000,['D']='A treetop village!',['N']='Treetop village',},[71]={['O']=19703,['C']=1.031000,['D']='Tamriel Botanical Gardens is open year round and displays rare plant species and eco-regions across Tamriel.\\r\\n\\r\\nCurrent Exhibits:\\r\\nAlinor/Classic Garden\\r\\nHigh Isle Ecotype\\r\\nCacti and Succulent Greenhouse\\r\\nMangrove and Coastal Beaches\\r\\n“Japanese”/Dunmeri Garden\\r\\nJungle with Tropical Greenhouse\\r\\nTemperate Aspen Forest\\r\\nEvergreen Forest\\r\\nMarsh/Swamp with Carnivorous Plant Bog\\r',['N']='Botanical Gardens',},[25]={['O']=19777,['C']=1.014000,['D']='Enjoy a romantic getaway at this steamy hot springs resort, hidden away in the jungles of Malabal Tor.  Enjoy a dip in our many aquatic features, waterfall laden spa pools, natural hot springs and private indoor sauna with jacuzzi and steam shower.  Our resort is open to any couples (or even group parties) looking to getaway at our serene and romantic resort.',['N']='Hot springs resort',},[26]={['O']=19899,['C']=1.030000,['D']='The Craglorn museum of Natural History: \\nHome to one of Tamriel\\'s largest private taxidermy collections!',['N']='Taxidermy Museum',},[22]={['O']=19850,['C']=1.024000,['D']='Tamriel\\'s Best Pizza Parlor is now open!  Serving up fresh Druidic stone baked pies made with the freshest ingredients from across Tamriel.  (We also now offer local delivery through the use of Psijiic portals!)',['N']='Pizza Parlor',},[12]={['O']=19901,['C']=1.030000,['D']='Welcome to Tamriel’s Finest Reptile Zoo and Center for Herpetology! \\r\\nCome and see some of Tamriel\\'s most exotic reptilian and amphibian species in their natural habitats.  LIVE KAGOUTI FEEDINGS: Daily at 12PM!\\r\\n',['N']='Reptile Zoo',},[77]={['O']=19903,['C']=1.048000,['D']='Downtown L.A-1956...',['N']='Film Noire',},[17]={['O']=19854,['C']=1.021000,['D']='A cozy farmhouse',['N']='Farmhouse',},[13]={['O']=19719,['C']=1.031000,['D']='A sphere of peaceful greenery',['N']='Forest sphere',},},['Version']=1773,['TS']=1719632949,}"
