R["oh__@corundum2003"]="{['Version']=1773,['na']={[64]={['C']=1.041000,['D']='Inspired by a thumbnail to some Youtube sleep music. Loved the ambience and the steampunk transport theme shown.  Enjoy :). ',['O']=19511,['N']='Woodland Bookstore',},[71]={['C']=1.017000,['D']='Inspired by the Hanging Gardens of Babylon descriptions. Thank you for visiting.',['O']=19106,['N']='Hanging Garden',},[8]={['O']=19432,['N']='Marbruk Seamstress',},[75]={['C']=1.041000,['D']='minor renovations',['O']=19147,['N']='Mountainside Village',},[12]={['C']=1.033000,['D']='Just a small druidic home in the fall.',['O']=19309,['N']='Druidic Home',},[13]={['C']=1.500000,['D']='A private caravan backed up into a secluded wood. What a wonderful way to explore Tamriel with almost all the comforts of home.',['O']=19230,['N']='Private Caravan',},[15]={['O']=18506,['N']='Tree House',},[80]={['C']=1.041000,['D']='Total redo of the village. All buildings and previous FX were removed/deleted and the town was rebuilt.   ',['O']=19281,['N']='Winter Fest Outpost',},[17]={['O']=18536,['N']='Wulfrite\\'s Taxidermy',},[82]={['C']=1.017000,['D']='School of magic - only reached by those who are invited in a dream. No more than 12 students per year are chosen to attend. ',['O']=19427,['N']='Enchanting School',},[22]={['O']=19230,['N']='Modern House',},[23]={['O']=18506,['N']='The Social Alchemist',},[25]={['C']=1.051000,['D']='',['O']=18864,['N']='Baandari Chemist',},[90]={['C']=1.037000,['D']='',['O']=18996,['N']='Doomchar Temple',},[91]={['C']=1.500000,['D']='Sweetwater Inn - come relax and recover from your journeys.',['O']=19171,['N']='Sweetwater Inn',},[94]={['C']=1.041000,['D']='',['O']=19792,['N']='Coral Atoll Village',},[32]={['C']=1.022000,['D']='',['O']=18977,['N']='Winter Solace',},[33]={['O']=18613,['N']='Bangkorai Stronghold',},[40]={['O']=18721,['N']='Grand Topal Manor',},[105]={['C']=1.017000,['D']='Druid Queen\\'s Castle',['O']=19805,['N']='Driud Queen\\'s Castle',},[42]={['C']=1.500000,['D']='A respite from the city bustle. ',['O']=19385,['N']='Vivec City Spa',},[44]={['O']=18791,['N']='Bag End',},[45]={['C']=1.017000,['D']='',['O']=18893,['N']='Tel Galen Sea Castle',},[49]={['O']=18601,['N']='Marsh Cottage',},[26]={['C']=1.020000,['D']='',['O']=19729,['N']='Crystal Walk',},[81]={['O']=18562,['N']='Skyrim Antique Guild',},[54]={['C']=1.017000,['D']='',['O']=18886,['N']='Winter Falls Castle',},[11]={['O']=18671,['N']='Lover\\'s Garden',},[56]={['C']=1.020000,['D']='Fantasy Forest Sanctuary',['O']=19110,['N']='Forest Sanctuary',},[89]={['C']=1.017000,['D']='Pantherfang Harbor is the first port into and the last port out of Blackwood, and a favorite stopping point for both locals and visitors for food, drink, repairs and wares.',['O']=18968,['N']='Pantherfang Harbor',},[86]={['O']=18742,['N']='Mage\\'s Guild Tower',},[18]={['O']=19160,['N']='Wayrest Inn & Bakery',},[60]={['C']=1.041000,['D']='Not a town proper, but Tribute Grotto, as its called, houses a large manor house with an upstairs tribute hall, ice house below, two smaller houses, a stable, and a large garden shrine.  There are also all crafting stations incorporated as well.',['O']=19255,['N']='Tribute Grotto',},[61]={['O']=18687,['N']='Irnskar\\'s Point',},[62]={['C']=1.041000,['D']='',['O']=19378,['N']='Psijic Canal Walk',},[63]={['O']=18952,['N']='Winter Cottage',},},['TS']=1711204096,['Key']='oh__@corundum2003',}"
