R["oh__@velarys"]="{['na']={[65]={['O']=19645,['C']=1.020000,['D']='',['N']='Dwarven Home',},[2]={['O']=19237,['C']=1.051000,['D']='Just a simple inn room.',['N']='Daggerfall Inn',},[38]={['O']=19287,['C']=1.026000,['D']='This castle is fully furnished from the guard tower to the servants\\' quarters installed in the top of the carriage house to the treasury just past the crypt and the priest of Arkay\\'s apartment. Includes throne room, chapel, fully stocked kitchen and dining hall in addition to the ruler\\'s private quarters. ',['N']='Daenia Dolmen Manor',},[8]={['O']=19143,['C']=1.051000,['D']='a comfortable altmer home with a private master bedroom on the ground floor. ',['N']='Marbruk House',},[9]={['O']=19150,['C']=1.037000,['D']='Warning: bright light ahead when entering main house.',['N']='Mathiisen House',},[10]={['O']=19271,['C']=1.051000,['D']='A very humble Argonian starter home. ',['N']='Dhalmora House',},[43]={['O']=19271,['C']=1.051000,['D']='With its ancient wall, basking pool and ample upper storage, this is a wonderful home for raising guar and saxhleel alike.',['N']='Hlaalu Home',},[12]={['O']=19271,['C']=1.026000,['D']='With its treasure guarded by vine-tongue and voriplasm, upstairs shrine, pottery workshop, stables, repurposed ruin library and spacious lower room, this Argonian home is truly luxurious. (Those who wish a challenge can search for the key to the lockbox)',['N']='Hatching Pools House',},[15]={['O']=19237,['C']=1.047000,['D']='This bosmer estate also serves as a wedding venue.',['N']='Cormount House',},[16]={['O']=19287,['C']=1.051000,['D']='',['N']='Daggerfall House',},[17]={['O']=19287,['C']=1.047000,['D']='Those inclined may search for the decorative safebox and key blank.',['N']='Fell\\'s Run House',},[18]={['O']=19287,['C']=1.051000,['D']='Welcome to Soul Portraits! Home to an artist who pays the bills with an enchanting shop out front. ',['N']='Wayrest House',},[75]={['O']=19736,['C']=1.007000,['D']='This isolated clanhold of Trinimac worshippers is under assault from Peryite\\'s forces. Can you find the hidden Daedric shrine and slay its guardian to save them? ',['N']='Wrothgar Village',},[48]={['O']=19188,['C']=1.051000,['D']='Need to get away from it all? This two-story and two-tower gem with secret crypt entrance may just be for you!',['N']='Falkreath Hall',},[49]={['O']=19287,['C']=1.020000,['D']='This cozy hermitage is the fishing lodge of a Psijic who likes to step away from Artaeum while staying well away from the cities of Nirn. ',['N']='Psijic Hermitage',},[33]={['O']=19579,['C']=1.051000,['D']='',['N']='Lakewatch House',},[58]={['O']=19136,['C']=1.051000,['D']='',['N']='Alinor Inn',},[59]={['O']=19164,['C']=1.051000,['D']='',['N']='Alinor House',},[73]={['O']=19546,['C']=1.051000,['D']='',['N']='Senchal House',},[44]={['O']=19645,['C']=1.051000,['D']='',['N']='Redoran Home',},[47]={['O']=19699,['C']=1.041000,['D']='A Patchwork Village with houses that have been scooped up from Tamriel in the Alinor, Dwemer, Solitude, Murkmire, and Elsweyr styles.',['N']='Patchwork Village',},[63]={['O']=19433,['C']=1.022000,['D']='',['N']='New Life Snow Globe',},},['Version']=1773,['Key']='oh__@velarys',['TS']=1705213080,}"
