R["oh__@sir_xalvador"]="{['Version']=1773,['na']={[80]={['N']='XaL\\'s  Homestead',['O']=19718,['C']=1.036000,['D']='Sir Xalvador traveled to his homeland, The Frozen Coast, and to the location of his Family home. Thoughts and memories of his childhood came rushing back to him, such as the time he allowed the only fire that lights the tunnel to go out. Through the years, the Family\\'s Eternal Flame still burns bright. Bundle up while traveling in Skyrim, the fridged tempertures can do some damage. If the cold gets too much, stop by to see if Xal is home, he welcomes all to warm themselves by the fire.',},[41]={['N']='Welwa Retreat',['O']=19302,['C']=1.041000,['D']='On the Off-beaten Path Lies Welwa Retreat, the last outpost for miles. Many come here to get a hot meal, repair their armor and get some rest before continuing on their journey to DragonStar Arena. As a land owner here in Craglorn, I love seeing all the people pass through on a daily basis. Some do stay however, they say they love this quaint little town nestled in a cavern in Craglorn, and they will never leave. Welcome to Welwa Retreat. Hope your visit is a Great one, Enjoy.',},[90]={['N']='Castle Corvinnus',['O']=19616,['C']=1.023000,['D']='You are entering into the tortured mind of Lord Marius Corvinnus. Marius, once an orphanned child growing up in the streets of Windhelm, has spent the last 100 years as a powerful Vampire Lord. \\r\\n\\r\\nInside the walls of this sinister castle, you will see stories, remnants of the past if you will, including four of his most victorious battles as well as a tribute to the Night Mother as she was the one who led him down this path when he was young. \\r\\n\\r\\nWish someone dead? Head South East to the Night ',},[54]={['N']='The Rose Kingdom',['O']=19238,['C']=1.017000,['D']='In the 2nd era King Xalvador learns of an assassination attemp on his life, he retreats to the frozen secluded mountains of Wrothgar with his family and loyal subjects to build \"The Rose Kingdom\". Providing a safe haven for his Family and Himself, while strategically planning to make it back to Skyrim, Come look at his magical castle and decide if he chose wisely.',},[98]={['N']='Catawba Island',['O']=19552,['C']=1.018000,['D']='Sailing from the Dreadsail reef, Sir Xalvador travels to a group of islands in the Abecean Sea, known as the Systres Isles, As XaL navigated through these islands, he came across  Catawba Island, and immediately fell in LOVE with the shop-lined Boardwalk there. It was a serene little town tucked away in a small cove with many things you can do, from a little bit of crafting and fishing, to getting dinner or enjoying a late night drink with the locals, Sail on in to Catawba Island Boardwalk.',},},['Key']='oh__@sir_xalvador',['TS']=1705190456,}"
