R["oh__@azriael2"]="{['eu']={[7]={['N']='Black Vine House',['O']=19561,},[43]={['N']='Serenity Lake',['C']=1.021000,['D']='Welcome to the enchanting elven retreat, magically fused with a realm of volcanoes. The soothing melodies of nature mingle with the fiery allure of volcanic peaks. Unwind in hot spring sanctuaries, while mystical energies dance around, creating a harmonious escape like no other.',['O']=19561,},[59]={['N']='Alinor Royal Academy',['C']=1.020000,['D']='Welcome to the newly renovated small magic academy! After an unfortunate professor\\'s experiment, the school has transformed into a vibrant, enchanted haven. Embrace the mystical ambiance and diverse magical courses, honing your powers in a safe and captivating environment. Unleash your potential in this bewitching sanctuary, where friendships flourish, and extraordinary adventures await!',['O']=19561,},[28]={['N']='Nimalten House',['C']=1.033000,['D']='Amidst dense trees, lies the autumnal home of a secretive, dark elf. Concealed in shadow, the dwelling exudes an eerie charm. Leaves of crimson and gold carpet the ground, while enchanting lanterns cast an otherworldly glow. Wisps of mist add an air of mystery, as whispers of ancient magic echo. Step cautiously into this hauntingly beautiful abode, where the essence of fall intertwines with elven enigma.',['O']=19561,},[77]={['D']='Step into the cozy room at the tavern. Soft furs, plush cushions, and flickering hearth embrace you. Wooden carvings and warm candlelight create a tranquil haven, inviting weary souls to unwind and find solace.',['C']=1.026000,['N']='Solitude Inn',['O']=19563,},[13]={['N']='Elden Root House',['C']=1.031000,['D']='Step into the woodland abode of the elven alchemist, a cozy one-room haven. Moonlit vines adorn the entrance, guiding you inside. Within, the room exudes an aura of natural wonder, with exotic plants lining every surface. Bioluminescent fungi cast a gentle glow, illuminating vials of enchanted elixirs. This enchanting nook melds the elf\\'s alchemical craft with the mesmerizing allure of the forest\\'s botanical treasures.',['O']=19561,},[63]={['N']='New Life Snow Globe',['C']=1.022000,['D']='Hidden within an enchanted snow globe, behold the festive home! A winter wonderland envelopes the quaint dwelling, nestled amidst swirling snowstorms. Twinkling lights adorn the eaves, casting a warm, inviting glow. Step inside to find crackling hearths, cozy blankets, and the scent of freshly baked treats. As snowflakes dance outside, the magic within the snow globe abounds, creating a picturesque holiday haven where joy and merriment fill the air.',['O']=19561,},},['Version']=1773,['TS']=1690256992,['Key']='oh__@azriael2',}"
