R["oh__@aff_afc"]="{['na']={[9]={['D']='Now bookable via the Nirn-BnB(TM) app; the former home of Altmer Lady Melanya of Mathiisen is this year\\'s Tamriel Bride magazine\\'s Wedding Venue of the Year. Celebrate your love in the Garden of Eternal Blossoms. Dance like there\\'s no tomorrow in the grand ballroom. Sleep soundly in the sumptuous master bedroom. Relax in our famous mineral water pools after a day exploring Auridon.',['C']=1.051000,['O']=19256,['N']='Chateau de Mo-nay',},[38]={['D']='Donald, Count de Mo-nay, welcomes guests of his wedding at the Palais de Mo-nay. The Breton sorcerer (45) is a renowned adventurer who owns a vast landholding across Glenumbra. The bride, Lady Melanya of Mathiisen (30), is an Altmer beauty immortalised in many paintings who now runs a successful fashion studio. Their whirlwind romance started at this year\\'s Imperial City Fashion Week, where he rescued her from a demonic portal that opened underneath the runway.',['C']=1.051000,['O']=19257,['N']='Palais de Mo-nay',},[18]={['D']='Welcome to the Atelier de Mo-nay. During the Wayrest Social Season, the Breton Count de Mo-nay, 45, and his Altmer wife (the renowned fashion designer Countess Melanya de Mo-nay, 30) reside at the Atelier.\\r\\nPrimarily used by the Countess to receive her exclusive clientele for consultation and fitting; the Count and Countess also host a Festival of the Dibellan Arts with a close-knit group of Dibella worshippers here.',['C']=1.051000,['O']=19268,['N']='Atelier de Mo-nay',},},['Version']=1769,['TS']=1664777273,['Key']='oh__@aff_afc',}"
