R["oh__@oonora"]="{['na']={[96]={['D']='Courtyard boasts all crafting stations, vetHM Dungeon dummy and vet Trial dummy; also in the courtyard are all 13 standing stones, a telescope to view the stars, a large tributary statue to Dibella and Saynu\\'s parents sarcophagus\\'. The inside is set up lavishly with a fully kitchen (including a provisioning station fireplace), fully catered dining room for 10, large library and study upstairs along with an alchemy corner and spare bedroom set for two. ',['C']=1.007000,['O']=19262,['N']='Stonecleaver Hold',},[29]={['D']='Set up as a cozy tavern with 7 beds upstairs, full kitchen and bar, along with a stage for any performances you choose, this snug and warm Eastmarch home on the eastern side of frozen Windhelm will keep you and your fellows and family toasty from the biting cold of the north. Think of it like a fancy Nordic BnB!',['C']=1.007000,['O']=19263,['N']='Windhelm House',},[44]={['D']='Located between a Dwarven ruin and a Daedric Shrine, this home constructed in the traditional Redoran \\'Bug\\' style is an easy getaway for those with curious, scholarly pursuits. Filled with places to organize your finds - or hide your treasures - it comes with a Khajiiti Scholar that goes around cataloging and organizing items for shipment, along with a fully stocked kitchen, spare bedroom, library with office and a master bedroom upstairs that has a door leading to the balcony for the view.',['N']='Redoran Home',['O']=19262,['C']=1.007000,},},['Key']='oh__@oonora',['Version']=1769,['TS']=1664342985,}"
